import { GET_PROJECTS, ADD_PROJECT, TOGGLE_TODO, DELETE_TODO } from './actionTypes'

export function getProjects(projects) {
  return { type: GET_PROJECTS, projects: projects }
}

export function addProject( name) {
  return { type: ADD_PROJECT, name: name }
}

export function toggleTodo(index) {
  return { type: TOGGLE_TODO, index: index }
}

export function deleteTodo(index) {
  return { type: DELETE_TODO, index: index }
}
